import React from 'react';
import Stack from './Stack.js';
import getGallery from './Gallery-get.js';

export default function Gallery() {
  return (
    <div className="HomePage">
      <div className="Header">
        <h1>KODFLIX</h1>
      </div>
        <div>{
          getGallery().map(stack => (
            <Stack
              key={Stack.id}
              id={stack.id}
              name={stack.name}
              logo={stack.logo}
            />))
        }
        </div>
      </div>
      );
    }
